import React, { useState, useCallback } from 'react';
import './App.css';
import Header from './components/Header';
import InputSection from './components/InputSection';
import { TriageState, TriageInput, TriageOutput } from './types/TriageTypes';
import { triageApi } from './services/triageApi';

function App() {
  const [triageState, setTriageState] = useState<TriageState>({
    caseId: null,
    currentQuestion: null,
    remainingQuestions: 0,
    triage: null,
    filePath: null,
    isLoading: false,
    error: null,
  });

  const [triageResults, setTriageResults] = useState<Array<{
    caseId: string;
    triage: TriageOutput;
    timestamp: string;
    patientName: string;
  }>>([]);

  const handleStartTriage = useCallback(async (input: TriageInput) => {
    setTriageState(prev => ({ ...prev, isLoading: true, error: null }));

    try {
      const response = await triageApi.startTriage(input);

      setTriageState(prev => ({
        ...prev,
        caseId: response.case_id,
        currentQuestion: null,
        remainingQuestions: 0,
        triage: response.triage,
        filePath: response.file_path,
        isLoading: false,
        error: null,
      }));

      // Add to results list
      const newResult = {
        caseId: response.case_id,
        triage: response.triage,
        timestamp: new Date().toLocaleString('tr-TR'),
        patientName: input.name
      };

      setTriageResults(prev => [newResult, ...prev]);

      return response;
    } catch (error: any) {
      setTriageState(prev => ({
        ...prev,
        isLoading: false,
        error: error.message,
      }));
      throw error;
    }
  }, []);

  const handleSendAnswer = useCallback(async (answer: string, skip: boolean = false) => {
    if (!triageState.caseId || !triageState.currentQuestion) return;

    setTriageState(prev => ({ ...prev, isLoading: true, error: null }));

    try {
      const body = {
        answers: { [triageState.currentQuestion]: skip ? '' : answer },
        done: false,
      };

      const response = await triageApi.sendAnswer(triageState.caseId, body);

      setTriageState(prev => ({
        ...prev,
        currentQuestion: null,
        remainingQuestions: 0,
        triage: response.triage,
        isLoading: false,
        error: null,
      }));

      // Update the result in the list
      setTriageResults(prev => 
        prev.map(result => 
          result.caseId === triageState.caseId 
            ? { ...result, triage: response.triage }
            : result
        )
      );

      return response;
    } catch (error: any) {
      setTriageState(prev => ({
        ...prev,
        isLoading: false,
        error: error.message,
      }));
      throw error;
    }
  }, [triageState.caseId, triageState.currentQuestion]);

  const handleDone = useCallback(() => {
    setTriageState(prev => ({ ...prev, currentQuestion: null, remainingQuestions: 0 }));
  }, []);

  const handleReset = useCallback(() => {
    setTriageState({
      caseId: null,
      currentQuestion: null,
      remainingQuestions: 0,
      triage: null,
      filePath: null,
      isLoading: false,
      error: null,
    });
  }, []);

  return (
    <div className="App">
      <Header />
      <main className="main-content">
        <div className="dashboard-container">
          <div className="input-panel">
            <InputSection
              triageState={triageState}
              onStartTriage={handleStartTriage}
              onSendAnswer={handleSendAnswer}
              onDone={handleDone}
              onReset={handleReset}
            />
          </div>

          <div className="results-panel">
            <h2>Triyaj Sonuçları</h2>
            {triageResults.length === 0 ? (
              <div className="no-results">
                <p>Henüz triyaj sonucu bulunmuyor.</p>
              </div>
            ) : (
              <div className="results-list">
                {triageResults.map((result, index) => (
                  <div key={result.caseId} className="result-card">
                    <div className="result-header">
                      <h3>Hasta: {result.patientName}</h3>
                      <span className="case-id">Vaka ID: {result.caseId}</span>
                      <span className="timestamp">{result.timestamp}</span>
                    </div>

                    <div className="result-content">
                      <div className="triage-level">
                        <strong>Triyaj Seviyesi:</strong> 
                        <span className={`level-badge level-${result.triage.triage_level.toLowerCase()}`}>
                          {result.triage.triage_level}
                        </span>
                      </div>

                      <div className="rationale">
                        <strong>Değerlendirme:</strong>
                        <p>{result.triage.rationale_brief}</p>
                      </div>

                      {result.triage.red_flags && Array.isArray(result.triage.red_flags) && result.triage.red_flags.length > 0 && (
                        <div className="red-flags">
                          <strong>Kırmızı Bayraklar:</strong>
                          <ul>
                            {result.triage.red_flags.map((flag, idx) => (
                              <li key={idx}>{flag}</li>
                            ))}
                          </ul>
                        </div>
                      )}

                      {result.triage.immediate_actions && Array.isArray(result.triage.immediate_actions) && result.triage.immediate_actions.length > 0 && (
                        <div className="immediate-actions">
                          <strong>Acil Eylemler:</strong>
                          <ul>
                            {result.triage.immediate_actions.map((action, idx) => (
                              <li key={idx}>{action}</li>
                            ))}
                          </ul>
                        </div>
                      )}

                      {result.triage.routing && (
                        <div className="routing">
                          <strong>Yönlendirme:</strong>
                          <p>Uzmanlık: {result.triage.routing.specialty || 'Belirtilmemiş'}</p>
                          <p>Öncelik: {result.triage.routing.priority || 'Belirtilmemiş'}</p>
                        </div>
                      )}
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
